import { TextField } from '@react-ui-org/react-ui';

const todoadd = () => {

    return (  
        <div className="AddToDo">
            <TextField id="addText" label="Thing To Do:" variant="standard"/>
            <button> Add </button>
        </div>
    );
}
 
export default todoadd ;
